import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Token Builder</h1>
      <h2>Build your own ERC20 token on the Ethereum blockchain!</h2>
      <form>
        <div><label>Initial Supply</label><input type="text"/></div>
        <div><label>Name</label><input type="text"/></div>
        <div><label>Symbol</label><input type="text"/></div>
        <div><label># of Decimal Places</label><input type="text"/></div>
        <div><input type="button" value="Submit"/></div>
      </form>
    </div>
  );
}

export default App;
